#!/usr/bin/python

def reverse_compliment(string):
    compliment = {'A':'T', 'T':'A',
                  'G':'C', 'C':'G'}
    ret_val = []
    for char in string[::-1]:
        ret_val.append(compliment[char])

    fi = open('rev_comp_output.txt', 'w')
    fi.write(''.join(ret_val))


reverse_compliment("")
